import React from "react";
import { Button , Container} from 'react-bootstrap';
let Footer = () => {
    return (
        <div className="bfooter">
            <Container>
                <div className="footer">
                    <div className="footer-header">
                     <img width="200px" src='/logo2.png'/>
                    </div>
                </div>
            </Container>
        </div>
    )
}

export default Footer
